import React, { useState, useEffect } from 'react';
import { Link, Navigate } from 'react-router-dom';
import '../css/Dashboard.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import imageLeft from '../images/Saree.png';
import imageRight from '../images/Saree_Right.png';
import Header from '../components/Header.js';
import Footer from './Footer.js';
import axios from 'axios';

import { FaShippingFast, FaBoxOpen, FaHeadset, FaLock } from 'react-icons/fa';

const Dashboard = () => {
    const [products, setProducts] = useState([]);
    const [redirect, setRedirect] = useState(false);
    useEffect(() => {
        axios.get('http://localhost:8080/api/products')
            .then(response => {
                setProducts(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the products!", error);
            });
    }, []);

    const handleSignUp = () => {
        setRedirect(true);
    };

    if (redirect) {
        return <Navigate to="/signUp" />;
    }
    console.log(products)
    const convertToImageUrl = (binary) => {
        if (!binary) return '';
        const base64String = btoa(
            new Uint8Array(binary)
                .reduce((data, byte) => data + String.fromCharCode(byte), '')
        );
     
        return `data:image/jpeg;base64,${base64String}`;
        
    };
   
    return (
        <div class="body">
            <Header />
            <div className="banner-container_dashboard">
                <div className="banner-images">
                    <img
                        className="banner-image-left"
                        src={imageLeft}
                        alt="Left Model"
                    />
                    <div className="banner-content text-center">
                        <h3 className="banner-title_dash">Unlock Exclusive Benefits: Elevate Your Fashion Experience!</h3>
                        <h4 className="banner-subtitle_dash">Become a PrimeOfferShop Member Today!</h4>
                        <button className="btn btn-primary banner-btn" onClick={handleSignUp}> Sign Up Now </button>
                    </div>
                    <img
                        className="banner-image-right"
                        src={imageRight}
                        alt="Right Model"
                    />
                </div>

            </div>
            <div className="product-section">
                <h2 className="section-title">Exclusive Offers</h2>
                <div className="product-grid">
                    {products.map((product) => (
                        <Link to={`/orderPage/${product.id}`} key={product.id} className="product-card">
                            <div key={product.id}>
                                {product.image && <img src={convertToImageUrl('')} alt={product.name} />}
                                <h3>{product.name}</h3>
                                <p>{product.price}</p>
                                <p>{product.description}</p>
                            </div>
                        </Link>
                    ))}
                </div>
            </div>
            <div className="marquee-container">
                <div className="marquee">
                    {items.map((item, index) => (
                        <div className="marquee-item" key={index}>
                            <div className="icon">{item.icon}</div>
                            <span className="text">{item.text}</span>
                        </div>
                    ))}
                </div>
            </div>
            <div className="best-sellers">
                <h2 className="section-title">Explore Our Best Sellers</h2>
                <div className="product-grid_best">
                    {best_sellers.map((product, index) => (
                        <Link to={product.link} key={index} className="product-card">
                            <div key={index}>
                                <img src={product.image} alt={product.name} />
                                <h3>{product.name}</h3>
                                <p>{product.price}</p>
                            </div>
                        </Link>
                    ))}
                </div>
            </div>
            <Footer />
        </div>
    );
};

const items = [
    { icon: <FaShippingFast />, text: 'EXPRESS SHIPPING AVAILABLE' },
    { icon: <FaBoxOpen />, text: 'SATISFACTION GUARANTEED' },
    { icon: <FaHeadset />, text: 'FAST CUSTOMER SUPPORT' },
    { icon: <FaLock />, text: 'SECURE PAYMENTS' },
];

const best_sellers = [
    {
        image: require('../images/img.png'),
        title: 'White Teal Green Mirror Worked Kurti',
        price: 'Rs. 3,630.00'
    },
    {
        image: require('../images/img.png'),
        title: 'Rani Pink Mustard Yellow Mirror Worked Kurti',
        price: 'Rs. 4,630.00'
    },
    {
        image: require('../images/img.png'),
        title: 'Green White Mirror Worked Kurti',
        price: 'Rs. 2,980.00'
    },
    {
        image: require('../images/img.png'),
        title: 'Dark Brown White Mirror Worked Kurti',
        price: 'Rs. 2,980.00'
    },
    {
        image: require('../images/img.png'),
        title: 'Yellow White Mirror Worked Kurti',
        price: 'Rs. 3,530.00'
    }
];
export default Dashboard;
